'use strict';
class StdlibQueue {
    data
    length() {
        return this.data.length;
    }
    enqueue(value) {
        this.data.push(value);
    }

    peek() {
        if (this.data.length == 0)
            return null;
        return this.data[0];
    }
    dequeue() {
        if (this.data.length == 0)
            return null;
        return this.data.shift();
    }
    clear() {
        this.data = [];
    }
    constructor() {
        this.data = [];
    }
}

let queue = StdlibQueue;
module.exports = queue;